ience, making this a perfect home for social gatherings of all kinds. The generously sized master bedroom features several windows for plenty of natural light, plus two large walk-in closets and a lavish master bath. The well-located laundry offers convenient counter space. Other highlights include a charming covered entry, an expansive great room that opens to the dining room, a roomy kitchen boasting a center island with counter seating, a loft area for additional living space, and large secondary bedrooms with walk-in closets.', null, null, null, '[{\"school_grade\":\"K-5\",\"school_distance\":0.2,\"school_name\":\"Quail Run Elementary\",\"school_score\":10},{\"school_grade\":\"6-8\",\"school_distance\":0.3,\"school_name\":\"Gale Ranch Middle\",\"school_score\":10},{\"school_grade\":\"9-12\",\"school_distance\":0.7,\"school_name\":\"Dougherty Valley High\",\"school_score\":10}]', null, '[{\"data\":[{\"y\":195,\"x\":5,\"xValue\":1467270000000,\"yValue\":924100},{\"y\":196,\"x\":53,\"xValue\":1469948400000,\"yValue\":922900},{\"y\":193,\"x\":101,\"xValue\":1472626800000,\"yValue\":926600},{\"y\":189,\"x\":147,\"xValue\":1475218800000,\"yValue\":933700},{\"y\":184,\"x\":195,\"xValue\":1477897200000,\"yValue\":940400},{\"y\":181,\"x\":241,\"xValue\":1480489200000,\"yValue\":946000},{\"y\":177,\"x\":289,\"xValue\":1483167600000,\"yValue\":952300},{\"y\":171,\"x\":337,\"xValue\":1485846000000,\"yValue\":960600},{\"y\":167,\"x\":381,\"xValue\":1488265200000,\"yValue\":966700},{\"y\":166,\"x\":429,\"xValue\":1490943600000,\"yValue\":968700},{\"y\":166,\"x\":475,\"xValue\":1493535600000,\"yValue\":968700},{\"y\":166,\"x\":523,\"xValue\":1496214000000,\"yValue\":969400}],\"name\":\"San Ramon\",\"regionType\":\"City\"},{\"data\":[{\"y\":109,\"x\":5,\"xValue\":1467270000000,\"yValue\":1057200},{\"y\":108,\"x\":53,\"xValue\":1469948400000,\"yValue\":1059700},{\"y\":104,\"x\":101,\"xValue\":1472626800000,\"yValue\":1064600},{\"y\":102,\"x\":147,\"xValue\":1475218800000,\"yValu